import React, {useState, useEffect} from 'react'
import axios from 'axios';

function HomeCasa() {

    const[rooms, setRoooms] = useState([]);

    useEffect(() => {
        const fetchData = async () => {
          try {
            const response = await axios.get('/api/v1/houses');
            const houses = response.data;
            setRoooms(houses);
            console.log(houses);
          } catch (error) {
            console.log(error);
          }
        };
    
        fetchData();
      }, []);

    return (
        <div>
            <h1>Welcome home</h1>
            <h2>There are {rooms.length} houses</h2>
        </div>
    )
}

export default HomeCasa
